import React from 'react';

const Footer = () => {
    return (
        <div>
            <footer>
            <nav className="navbar text-bg-dark shadow">
                <div className="container-fluid">
                    <p className="text-end" sty>Navbar</p>
                </div>
            </nav>
            </footer>
           
        </div>
    );
}

export default Footer;
